import React from "react";
import { Carousel } from "react-bootstrap";

export default function CarouselBootstrap() {
  return (
    <div>
      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="https://media.istockphoto.com/vectors/depression-concept-horizontal-blue-background-vector-id1097295734?k=6&m=1097295734&s=612x612&w=0&h=KCOn8qV1t-k5JrTMlxM41MiA8NRVh8iSkKitSINe9sw="
            alt="First slide"
          />
          <Carousel.Caption>
            <h3> First slide label </h3>{" "}
            <p> Nulla vitae elit libero, a pharetra augue mollis interdum. </p>{" "}
          </Carousel.Caption>{" "}
        </Carousel.Item>{" "}
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="https://media.istockphoto.com/photos/christmas-festive-red-and-green-spiral-tunnel-striped-twisted-xmas-picture-id1061380312?k=6&m=1061380312&s=612x612&w=0&h=Tg_iOLBRyNas_Efu8B0CCvVh91ozgxWzxxtrC9OUAgI="
            alt="Third slide"
          />
          <Carousel.Caption>
            <h3> Second slide label </h3>{" "}
            <p> Lorem ipsum dolor sit amet, consectetur adipiscing elit. </p>{" "}
          </Carousel.Caption>{" "}
        </Carousel.Item>{" "}
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="https://media.istockphoto.com/photos/fantasy-room-full-of-glass-spheres-picture-id870290466?k=6&m=870290466&s=612x612&w=0&h=xB7UG0743gM-fWB6s7bs3kqQOSBJerxHZmYOBM7c0D4="
            alt="Third slide"
          />
          <Carousel.Caption>
            <h3> Third slide label </h3>{" "}
            <p>
              {" "}
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.{" "}
            </p>{" "}
          </Carousel.Caption>{" "}
        </Carousel.Item>{" "}
      </Carousel>
    </div>
  );
}
